window.bookSummaryJSON = "<p><i>My past will catch up with me.</i><br> <i>It will catch up with me not.</i><br> <i>My past will catch up with me -</i></p> <p>Teagan has finally found a home and a werewolf pack in the supernatural town of Greyhaven. She escaped her captors, and now she has a stable job and five werewolf mates. Well, two are actually her mates, and she has three werewolves that treat her like their friend, while she lusts after them. For the first time in a very long time, Teagan has everything to lose....</p> <p>Of course, the universe won’t just let her be happy.</p> <p>Someone powerful is attempting to destroy Grayhaven’s mystical defenses from the outside, and Teagan was the one who unwittingly caused the magical breach. The very fabric of the town is in danger, and it’s all Teagan’s fault. Can she and her mates discover the truth behind the attacks before their safe haven turns on them?</p> <p><b>Venture back into the Supernatural Town of Greyhaven in this steamy Why Choose follow-up to Escaping Monsters. We highly recommend listening to the Greyhaven series in order.</b></p>"; 
